import React, { Component } from 'react';

import Container from 'react-bootstrap/Container'
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import ItemButton from "../components/ItemButton";
import SearchBar from "../components/SearchBar";
import FilterAzerite from "../components/Azerite/FilterAzerite";
import ItemsContainer from "./ItemsContainer";
import { BrowserRouter as Router, Route} from "react-router";

class NavButtonsContainer extends Component {
    render() {
        return (
            <Container>
                <Row>
                    <Col><ItemButton name="Azerite" /></Col>
                    <Col><ItemButton name="Weapons" /></Col>
                    <Col><ItemButton name="Trinkets" /></Col>
                </Row>

                <Route path="/azerite">
                    <Row>
                        <Col><SearchBar /></Col>
                        <Col><FilterAzerite /></Col>
                    </Row>
                    <Row>
                        <NavButtonsContainer />
                    </Row>
                    <Row>
                        <ItemsContainer />
                    </Row>
                </Route>
            </Container>
        )
    }
}

export default NavButtonsContainer
